import Paper from '@mui/material/Paper';
import Button from '@mui/material/Button';
import React,{useState,useEffect,useMemo} from 'react';
import {useNavigate,useParams} from "react-router-dom";
import axios from "axios";
import { Box,TextField } from '@mui/material';
import NavbarAdmin from './adminNav';
const EditOrder = () => {
    const api=axios.create({
        baseURL:"http://localhost:5000/special"
    })
    const [rows,setrows]=useState([]);
    const nav=useNavigate();
    useEffect(()=>{
        api.get('/watchorder',
    {
      withCredentials:true
    }
  ).then(res=>{
    let bd=res.data;
    if(res.status===200){
        console.log(res);
    //   setrows([...bd])
    }
       // setErrmsg("Successfull login")
    console.log(res);
  }).catch(err=>{
    if (err.response) {
      nav('/adlogin') 
      console.log(err);
  } else if (err.request) {
      // The client never received a response, and the request was never left
      nav('/adlogin') 
      console.log(err);
  } else {
      // Anything else
      // nav('/adlogin') 
      console.log(err);
  }
  });

    },[])
    return ( 
        <>
        <NavbarAdmin/>
        <div sx={{position:"absolute" ,
            top:"100px"}}
            >
            <p>Value</p>
            <Box>
        <TextField defaultValue={"profiles.managerFname"} disabled label="Manager FirstName" sx={{
            marginLeft:"20px",
            marginTop:"10px"
        }} ></TextField> 
        <TextField defaultValue={"profiles.manageLname"} disabled label="Manager LastName"sx={{
            marginLeft:"20px",
            marginTop:"10px"
        }}  ></TextField> 
        <br></br>
        <br></br>
        <TextField defaultValue={"profiles.companyName"} disabled label="CompanyName" sx={{
            marginLeft:"20px",
            marginTop:"10px"
        }} ></TextField> 
        <TextField defaultValue={"profiles.phoneNo"} disabled label="Phone No" sx={{
            marginLeft:"20px",
            marginTop:"10px"
        }} ></TextField>
        <br></br>
        <br></br>
        <TextField defaultValue={"profiles.region"} disabled label="Region" sx={{
            marginLeft:"20px",
            marginTop:"10px"
        }} ></TextField>
        <br></br>
        <br></br>
        <TextField defaultValue={"profiles.city"} disabled label="City" sx={{
            marginLeft:"20px",
            marginTop:"10px"
        }} ></TextField>
        <TextField defaultValue={"profiles.Stream"}disabled label="Stream" sx={{
            marginLeft:"20px",
            marginTop:"10px",
            marginBottom:"30px"
        }} ></TextField>
        </Box>
        </div>


    </>);
}
 
export default EditOrder;
